import {React , useRef} from 'react'
import './login.css'
export default function Login() {

  const handleclick = (e) => {
    const email = useRef();
    const password = useRef();
    e.prevent.default();
    console.log(email);
  }

	return (
		<div className="login">
      <div className="loginWrapper">
        <div className="loginLeft">
          <h3 className="loginLogo">Vyavhar</h3>
          <span className="loginDesc">
            The MayaWorld is Cruel Yaar...
          </span>
        </div>
        <div className="loginRight">
          <form className="loginBox" onSubmit={handleClick}>
            <input placeholder="Email" type='email' ref={email} required className="loginInput" />
            <input placeholder="Password" type='password' ref={password} required className="loginInput" />
            <button className="loginButton">Log In</button>
            <span className="loginForgot">Forgot Password?</span>
            <button className="loginRegisterButton">
              Create a New Account
            </button>
          </form>
        </div>
      </div>
    </div>
	)
}
